import React from 'react';
import logo from './logo.png';
import './App.css';
import './index.css'

import Signup from './components/signup'

function App() {
  return (

    <div className="App"> 
      <header>
        <img src={logo}  width="116" height="43"></img>
      </header>

      <body>
        <Signup/>        
      </body>

      <footer>
        <h3>already making postive ripples? log in</h3>
      </footer>
    </div>
  );
}

export default App;
